module FullAdd(
    input a, b, cin,
    output sum, cout
);
    wire axb, a_and_b, b_and_cin, a_and_cin;

    xor(axb, a, b);
    xor(sum, cin, axb);
    and(a_and_b, a, b);
    and(b_and_cin, b, cin);
    and(a_and_cin, a, cin);
    or(cout, a_and_b, b_and_cin, a_and_cin); 
endmodule

module Adder(
    input [3:0] a, b,
    input cin,
    output [3:0] sum,
    output cout
);
    wire c1, c2, c3;

    FullAdd fa0(a[0], b[0], cin, sum[0], c1);
    FullAdd fa1(a[1], b[1], c1, sum[1], c2);
    FullAdd fa2(a[2], b[2], c2, sum[2], c3);
    FullAdd fa3(a[3], b[3], c3, sum[3], cout);
endmodule

`timescale 1ns / 1ps

module test();
    reg [3:0] a, b;
    reg cin;
    wire [3:0] sum;
    wire cout;


    Adder rca(a, b, cin, sum, cout);

    initial begin
        a = 4'b0101; b = 4'b0011; cin = 0;
        #10 a = 4'b1100; b = 4'b0111; cin = 1;
        #10 $finish;
    end
endmodule
